import React, { useState, useEffect } from 'react';
import Moment from 'react-moment';
import 'moment-timezone';

export default class Date extends React.Component {
    render() {
        const fullDate = new Date();
        return (
            <Moment format=" dddd | Do mmmm gggg">
                {fullDate}
            </Moment>
        );
    }
}
